    letter-spacing: 0.5px;
    border-radius: 15px;
    box-shadow: 0 0 37px rgba(8, 21, 66, 0.05);
    border: none !important;
    position: relative;
    display: flex;
    flex-direction: column;
    min-width: 0;
    background-color: #fff;
